import React from "react";

const headerStyle = {
  color: '#f3be85',
  padding: '20px',
  display: 'flex',
  justifyContent: 'space-between'
}


const Header = () => {
  return (
    <div>
      <style jsx>{`
          .header {
             color: #e3880f;
             padding: 20px;
             display: flex;
             justifyContent: space-between;
             background: #353535;
          }
          ul {
            list-style:none;
            display: flex;
            height: 20px;
            font-size: 20px;
          }

          ul li {
            margin: 0px 12px;
            color: white;
            cursor: pointer;
          }

           ul li:hover {
             color: #e3880f;
           }

           ul li a {
            text-decoration: none;
            margin: 10px;
          }


      `}</style>
      <header className="header" style={headerStyle}>
        <section>
          <h1>ViajaEnVan</h1>
          <p>Brindamos la experiencia de viajar</p>
        </section>

        <ul>
          <li>Inicio</li>
          <li>Destinos</li>
          <li>Servicios</li>
          <li>Cotactenos</li>
        </ul>
      </header>
    </div>
  );
};

export default Header;
